import React from 'react';

const Footer = () => {
  return (
    <footer className="footer">
      <p>© 2024 שרגא גבריאל , כל הזכויות שמורות.</p>
      <div className="footer-links">
        <a href="https://linkedin.com" target="_blank" rel="noopener noreferrer">לינקדין שלי</a>
        <a href="https://github.com" target="_blank" rel="noopener noreferrer">גיטהאב שלי</a>
      </div>
    </footer>
  );
};

export default Footer;
